I canâ€™t believe the amount of people who still (delusionally) believes Dina shouldâ€™ve won just because of the _one single error_ Linoy did in the ribbon routineâ€¦.so, let me explain why and how Dina lost *fair and square* to Linoy - nothing major, just some facts that always get (conveniently) forgottenâ€¦

1) A rhythmic gymnastics competition is not made by one routine, but by 4 routines;
2) The final score is made by the sum of those 4 routinesâ€™ scores; 
3) Linoyâ€™s difficulty scores were consistently the highest in _all_ her 4 routines (ribbon included, as execution errors have no impact on the difficulty score); 
4) Dinaâ€™s difficulties on the other hand were lower and her execution not as consistent as Linoyâ€™s (as proven by small imperfections in all Dinaâ€™s routines and *Linoy getting a higher execution score as well* in a couple of her routines); 
5) Linoy paid for that mistake in her ribbon (with a very low execution score for the routine); 
6) Dina got the highest score of all in the ribbon rotation (proof that judgement was fair and on point).

